import { useState } from "react";

const Greeting = () => {
  const [text, setText] = useState('Change me');

  const handleChangeText = () => {
    setText('You did it')
  }

  return (
    <div>
      <h2>Hello World</h2>
      <p>I am React developer. I can help you!</p>
      <button onClick={handleChangeText}>Change text</button>
    </div>
  );
};

export default Greeting;
